import axios from "axios"
import React,{ useEffect, useState } from "react";
import './static/Projects.css'

const Table = (props)=>{
    const Projects = props.Data.filter((item)=>{
        return item.category === props.category
    })
    return(
        <><div></div>
        <table className="table">
            <tr>
                <th>Title</th><th>Category</th><th>Sub Category</th><th>View</th>
            </tr>
            {Projects.map((project)=>(<tbody>
            <tr key={project._id}>
            <td>{project.title}</td>
            <td>{project.category}</td>
            <td>{project.sub_category}</td>
            <td>View</td>
            </tr>
            </tbody>))}
        </table>
        </>
    )
}

const Projects = (props)=>{
    const [Data,SetData] = useState([]);
    async function fetchProduct(){
        const response = await axios.get("http://localhost:5000/view/view_product");
        SetData(response.data)
    }
    useEffect(()=>{
        fetchProduct()
    },[])
    
    return(
        <>
        <ul>
            {props.Categories.map((cat)=>(
                <div key={cat._id}>
                    {cat.category}
                    <Table Data={Data} category={cat.category}/>
                </div>))}
        </ul>
        
        </>
    )
}
export default Projects;
